import axios from "axios";

export function deleteTask(id) {
  return async function (dispatch) {
      console.log("estoy en la action");
      console.log()
    const task = await axios.delete(`http://localhost:3001/task/${id}`);

    return dispatch({
      type: "DELETE_TASK",
      payload: task.data,
    });
  };
}

export default deleteTask;
